oxy_webhelp_navlinks = {"getting-started-d728e353":{"topics":[{"title":"Unpacking the EV-Charger","shortdesc":"<p class=\"shortdesc\">When you receive your new EV-Charger, please check the contents of the package to ensure that everything is included.<\/p>","href":"topics\/unpacking_the_ev-charger_2.html","attributes":{"data-id":"unpacking-the-ev-charger"},"menu":{"hasChildren":false},"tocID":"unpacking-the-ev-charger-d728e364","topics":[]},{"title":"Understanding the EV-Charger components","shortdesc":"<p class=\"shortdesc\">The EV-Charger consists of a charging unit, power cord, and a plug that connects to the electrical outlet.<\/p>","href":"topics\/understanding_the_ev-charger_components_2.html","attributes":{"data-id":"understanding-the-ev-charger-components"},"menu":{"hasChildren":false},"tocID":"understanding-the-ev-charger-components-d728e375","topics":[]},{"title":"Location requirements for the EV-Charger","shortdesc":"<p class=\"shortdesc\">Before installing the EV-Charger, you need to choose a suitable location.<\/p>","href":"topics\/location_requirements_for_the_ev-charger_2.html","attributes":{"data-id":"location-requirements-for-the-ev-charger"},"menu":{"hasChildren":false},"tocID":"location-requirements-for-the-ev-charger-d728e386","topics":[]},{"title":"Preparing the site for installation","shortdesc":"<p class=\"shortdesc\">Before installing the EV-Charger, you need to ensure that the electrical wiring is compatible with the EV-Charger's requirements. You may need to hire an electrician to install a dedicated circuit for the EV-Charger.<\/p>","href":"topics\/preparing_the_site_for_installation_2.html","attributes":{"data-id":"preparing-the-site-for-installation"},"menu":{"hasChildren":false},"tocID":"preparing-the-site-for-installation-d728e397","topics":[]}]}};